con:eventHandlers.con:script:
import groovy.xml.*
import java.util.ArrayList

keys= new java.util.ArrayList()
values= new java.util.ArrayList()
def parsedxml = new XmlSlurper().parseText(context.requestContent)
def xmlClass= parsedxml.getClass()
def gpathClass= xmlClass.getSuperclass()
def namespaceTagHintsField=gpathClass.getDeclaredField("namespaceTagHints")
namespaceTagHintsField.setAccessible(true)
def namespacedeclarations = namespaceTagHintsField.get(parsedxml)
def trail= namespacedeclarations.toMapString()
keys.addAll(namespacedeclarations.keySet().toArray())
values.addAll(namespacedeclarations.values().toArray())
def display

def traverse(node)
{
                node.breadthFirst().each{
                                prefix=keys[values.indexOf(it.namespaceURI())]
                                context.requestContent=context.requestContent.replace('<'+prefix+':'+it.name()+'></'+prefix+':'+it.name()+'>', '<'+prefix+':'+it.name()+' xsi:nil="true" xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance"/>' )
                                }

}

traverse(parsedxml)
